import logo from './logo.svg';
import './App.css';
import './custom.scss'
import NavBar from './components/navbar';
import Table from './components/table';
import {Helmet} from "react-helmet";

function App() {
  return (
    <div className="container-fluid">
      <Helmet>
        <meta charSet="utf-8" />
        <title>Pokemon Team Builder</title>
        <body className="box border border-12 border-dark"/>
      </Helmet>
      {/* Header */}
      <div className="row">
        <NavBar />
      </div>
      <div className="row">
        <div class="col-8 fs-4">
          <Table/>
        </div>
      <div className="row mt-3">
        <div className="col">
          <button type="button" class="btn btn-dark btn-lg me-2">Calculate</button>
          <button type="button" class="btn btn-dark btn-lg">Reset</button>
        </div>
      </div>
      <div className="row">
        <div className="col">
          <div className="fs-3">Un-Resisted: </div>
          <div className="fs-3">Recommended Additions: </div>
          <div className="fs-3">Rating: </div>
        </div>
      </div>
      </div>
    </div>
  );
}

export default App;
